import React from 'react';
import { View, StyleSheet } from 'react-native';

const Header = () => {
    return (
        <View style={styles.h_container}>

        </View>
    );
}

const styles = StyleSheet.create({
    h_container: {
        width: '100vw',
        height: '40vh',
        backgroundColor: "blue",
    }

})

export default Header;
